import { Button } from "reactstrap";
import "./Servicos.css"

const Servicos = (props) => {
    return (<div className="container-servicos">
        <img src={props.src}></img>
        <h1>{props.titulo}</h1>
        <p>{props.descricao}</p>
        <Button href="/servicos/#sec">Saiba mais</Button>

    </div>);
}

export default Servicos;
